import React from "react";

export const CardList = (props) => {
	const monsters = props.monsters;
	return (
		<div className="card-list">
			{this.state.monsters.map((monster) => (
				<h1 key={monster.id}> {monster.name} </h1>
			))}
		</div>
	);
};
